A friend of mine decided to hook me up with Jeny. She called Ash and I and asked us to meet them for lunch. I met Jeny and we hit it off right away. She didnt want to beat around the bush and I just wanted to beat the bush, or in her case, a bushless puss. She said she appreciated people who were blunt, to the point and honest so I told her I wanted to fuck her straight out. No strings attached. Just a good time. After dealing with her ex for so long, she was more than thrilled to finally unwind and just have some fun. I think this is the first time in many, many moons I actually used my workout equipment. We didnt really exercise but we sure as hell worked out.
